        {name:"Jassi", age: 29, doB: "07/07/1992", email: "shaandar@kroad.com"},
      ]
    )

    const userInputHandler =(inputs) =>{
      setUserList(inputs);
      console.log(inputs, "Coming From Ap")
    }
  return (
    <div>
